import logo from "./logo.svg";
import "./App.css";
import headerImg from "./images/extch.png";

function Header() {
  return (
    <>
      <img class="img" src={headerImg} alt="ExTech logo" width></img>
      <div>
        <center>
          <h1>Exemplify tech. Job searching. Simplified.</h1>
        </center>
        <center>
          <h3>
            With the company roles, dates, and apply links, we strive to
            simplify the job searching & filtering process, catered towards your
            needs.
          </h3>
        </center>
      </div>
    </>
  );
}

export default Header;
